import React from 'react';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';
import { styled } from '@mui/material/styles';
import skillImage1 from '../../assets/images/python-analytics-visualization.png'; // ensure the path is correct

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(2),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const Skills = () => {
  const skills = [
    {
      title: 'Python Analytics & Visualization',
      skills: 'Python programming, statistical analysis, data visualization (bar, pie, histogram, 3D plots), data cleaning techniques, linear regression, graph interpretation.',
      description: 'Proficient in Python for analyzing and visualizing data, with a focus on practical applications in statistics, data cleaning, and trend analysis.',
      imageUrl: skillImage1, // using imported image
    },
    // ... add other skills here
  ];

  return (
    <Box
      sx={{
        p: 3,
        backgroundColor: 'black',
        color: 'white',
      }}
    >
      <Grid container spacing={3}>
        {skills.map((skill, index) => (
          <Grid item xs={12} sm={6} md={4} key={index}>
            <Item>
              <img src={skill.imageUrl} alt={skill.title} style={{ maxWidth: '100%', height: 'auto' }} />
              <Typography variant="h5" component="h3">{skill.title}</Typography>
              <Typography variant="h6" component="h4">Skills:{skill.skills}</Typography>
              <Typography variant="body2">Description{skill.description}</Typography>
            </Item>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default Skills;
